import { View, Text, TouchableOpacity, Image } from "react-native"

export function Home() {
    return (
        <View>
            <Image
                style={{width: "375px", height: "446px"}}
                source={require('../../../assets/homebg.png')}
            />
            <Text>
                <Text>Sejam Bem Vindos</Text>
            </Text>
        </View>
    )
}
